import React, { Component } from 'react'; 

// css
import './index.css';
import CardList from './CardList'

// fetch
import 'whatwg-fetch';



export default class CardPage extends Component {
    constructor() {
        super();
    }

    render() {

        return(
            <div>
                <CardList info={this.props.info} handleClick={this.handleClick} treeCallback={this.props.treeCallback}/>
            </div>
        );
    }

}
